import './App.css';

function App() {
  return (
    <div className="App">
      <h1>
         Programare Notari     
      </h1>

      <div class='group-1'> 
      <select id="Type" onchange='selectSearchType()'>
        <input placeholder='Alege specialistul'>Alege specialistul</input>
        <option value='notar' class='Level'>Notar</option>
        <option value='executor' class='Level'>Executor</option>
      </select>
      </div>
    </div>
  );
}

export default App;
